static gboolean
user_store_processor_dispatch_call (ThriftDispatchProcessor *dispatch_processor,
                                    ThriftProtocol *input_protocol,
                                    ThriftProtocol *output_protocol,
                                    gchar *method_name,
                                    gint32 sequence_id,
                                    GError **error)
{
  user_store_processor_process_function_def *process_function_def;
  gboolean dispatch_result = FALSE;

  UserStoreProcessor *self = USER_STORE_PROCESSOR (dispatch_processor);
  ThriftDispatchProcessorClass *parent_class =
    g_type_class_peek_parent (USER_STORE_PROCESSOR_GET_CLASS (self));

  process_function_def = g_hash_table_lookup (self->process_map, method_name);
  if (process_function_def != NULL)
  {
    g_free (method_name);
    dispatch_result = (*process_function_def->function) (self,
                                                         sequence_id,
                                                         input_protocol,
                                                         output_protocol,
                                                         error);
  }
  else
  {
    dispatch_result = parent_class->dispatch_call (dispatch_processor,
                                                   input_protocol,
                                                   output_protocol,
                                                   method_name,
                                                   sequence_id,
                                                   error);
  }

  return dispatch_result;
}

static void
user_store_processor_set_property (GObject *object,
                                   guint property_id,
                                   const GValue *value,
                                   GParamSpec *pspec)
{
  UserStoreProcessor *self = USER_STORE_PROCESSOR (object);

  switch (property_id)
  {
    case PROP_USER_STORE_PROCESSOR_HANDLER:
      if (self->handler != NULL)
        g_object_unref (self->handler);
      self->handler = g_value_get_object (value);
      g_object_ref (self->handler);
      break;
    default:
      G_OBJECT_WARN_INVALID_PROPERTY_ID (object, property_id, pspec);
      break;
  }
}

static void
user_store_processor_get_property (GObject *object,
                                   guint property_id,
                                   GValue *value,
                                   GParamSpec *pspec)
{
  UserStoreProcessor *self = USER_STORE_PROCESSOR (object);

  switch (property_id)
  {
    case PROP_USER_STORE_PROCESSOR_HANDLER:
      g_value_set_object (value, self->handler);
      break;
    default:
      G_OBJECT_WARN_INVALID_PROPERTY_ID (object, property_id, pspec);
      break;
  }
}

static void
user_store_processor_dispose (GObject *gobject)
{
  UserStoreProcessor *self = USER_STORE_PROCESSOR (gobject);

  if (self->handler != NULL)
  {
    g_object_unref (self->handler);
    self->handler = NULL;
  }

  G_OBJECT_CLASS (user_store_processor_parent_class)->dispose (gobject);
}

static void
user_store_processor_finalize (GObject *gobject)
{
  UserStoreProcessor *self = USER_STORE_PROCESSOR (gobject);

  thrift_safe_hash_table_destroy (self->process_map);

  G_OBJECT_CLASS (user_store_processor_parent_class)->finalize (gobject);
}

static void
user_store_processor_init (UserStoreProcessor *self)
{
  guint index;

  self->handler = NULL;
  self->process_map = g_hash_table_new (g_str_hash, g_str_equal);

  for (index = 0; index < 15; index += 1)
    g_hash_table_insert (self->process_map,
                         user_store_processor_process_function_defs[index].name,
                         &user_store_processor_process_function_defs[index]);
}

static void
user_store_processor_class_init (UserStoreProcessorClass *cls)
{
  GObjectClass *gobject_class = G_OBJECT_CLASS (cls);
  ThriftDispatchProcessorClass *dispatch_processor_class =
    THRIFT_DISPATCH_PROCESSOR_CLASS (cls);
  GParamSpec *param_spec;

  gobject_class->dispose = user_store_processor_dispose;
  gobject_class->finalize = user_store_processor_finalize;
  gobject_class->set_property = user_store_processor_set_property;
  gobject_class->get_property = user_store_processor_get_property;

  dispatch_processor_class->dispatch_call = user_store_processor_dispatch_call;
  cls->dispatch_call = user_store_processor_dispatch_call;

  param_spec = g_param_spec_object ("handler",
                                    "Service handler implementation",
                                    "The service handler implementation "
                                    "to which method calls are dispatched.",
                                    TYPE_USER_STORE_HANDLER,
                                    G_PARAM_READWRITE);
  g_object_class_install_property (gobject_class,
                                   PROP_USER_STORE_PROCESSOR_HANDLER,
                                   param_spec);
}
